    <div class="wrapper">
        <h3 class="--mgb20">Мы не просто <span class="--lightViolet">выгодно</span></h3>
        <div class="section__big-text">
            <p>Продаем</p>
        </div>
        <div class="section__big-text --mgb20">
            <p class="text-align-end">и покупаем</p>
        </div>
